    fetch("/admin/viewAdmins")
    .then(res=>res.json())
    .then(result=>{
        console.log(result)
       if(result.error){
          M.toast({html: result.error,classes:"#c62828 red darken-3"})
       }
       else{
            // console.log(result)
             setData(result.admins)
       }
    }).catch(err=>{
        console.log(err)
    })
   },[])
    return(
       


        <div>
            {
                data.map(item=>{
                    return(
                        <tr>
                            <td>{item.id}</td>
                            <td>{item.firstNmae}</td>
                            <td>$0.87</td>
                            <td>view</td>
                        </tr>
                    )
                })
            }
        </div>
          
          
      
      
    )
}

